import styled from "styled-components";
import PropsBox from "./Components/Props/PropsBox";
import ReduxBox from "./Components/Redux/ReduxBox";

const StartPropsBox = styled(PropsBox)`
  width: 40px;
  height: 40px;
  background-color:black;
`

const StartReduxBox = styled(ReduxBox)`
  width: 40%;
  height: 40%;
  background-color:black;
`

const BackDiv = styled.div`
  display:flex;
  align-items:center;
  justify-content:center;
  height:100vh;
`

function App() {
  return (
    <BackDiv>
      <StartPropsBox />

    </BackDiv>
  );
}

export default App;
